  `pay_id` int(11) NOT NULL AUTO_INCREMENT,
  `sell_buy_id` int(11) NOT NULL,
  `cust_supp_id` int(11) NOT NULL,
  `amount` double NOT NULL,
  `payment_type` int(1) NOT NULL COMMENT '1=cash; 2=check',
